	add("retail", "{\"term\":\"retail\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From the Old french (842-ca. 1400) verb \u0027retaillier\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The sale of goods directly to the consumer; encompassing the storefronts, mail-order, websites, etc., and the corporate mechanisms, branding, advertising, etc. that support them, which are involved in the business of selling and point-of-sale marketing retail goods to the public\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She works in \u0027\u0027retail\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Retail price; full price; an abbreviated expression, meaning the full suggested price of a particular good or service, before any sale, discount, or other deal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I never pay \u0027\u0027retail\u0027\u0027 for clothes\", \"priority\":4}]}, \"synonyms\":{}}");

