	add("retcon", "{\"term\":\"retcon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A {{blend|retroactive|continuity|nocap\u003d1|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A situation, in a soap opera or similar serial fiction, in which a new storyline explains or changes a previous event or attaches a new significance to it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027. Glen Cadigan, \u0027The Legion Companion\u0027, p. 152\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"TLC: \u0027What do you say to the Legion fans who have become disenfranchised with the series due to its various \u0027\u0027retcons\u0027\u0027 and reboots\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027. Rhonda Wilcox, \u0027Why Buffy Matters: The Art of Buffy the Vampire Slayer\u0027, p. 9\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Fans talk of \u0027\u0027retcon\u0027\u0027—retroactive continuity—giving information that explains an earlier event, especially seeming plot contradictions or lacunae\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027. Glenn Yeffeth, ed., \u0027The Man from Krypton: A Closer Look at Superman\u0027, p. 155\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s a little trick called \u0027\u0027retcon\u0027\u0027, short for \u0026quot;retroactive continuity,\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Yet I\u0027m unsure even Millar is fully aware of the power given him by the \u0027\u0027retcon\", \"priority\":8}]}, \"synonyms\":{}}");

