	add("reticle", "{\"term\":\"reticle\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027reticulum\u0027 diminutive of Latin \u0027rete\u0027 (net)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A grid, network, or crosshatch found in the eyepiece of various optical instruments to aid measurement or alignmen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A small ne\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1833\u0027\u0027, Francis Vesey, [http://books.google.co.uk/books?id\u003dMHIDAAAAQAAJ \u0027A General Digested Table and Index of Cases Argued and Determined in the High Court of Chancery\u0027, vol. 20], page ix\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"On the following day Mrs. \u0027Kent\u0027 went into the bed-room; and laid a \u0027\u0027reticle\u0027\u0027, which contained the money, upon her bed; and afterwards returned into the sitting-room; leaving the door between that and the bed-room open. After she had remained in the sitting-room about five minutes, she sent Miss \u0027S.\u0027 for the \u0027\u0027reticle\u0027\u0027; and it was not to be found\", \"priority\":4}]}, \"synonyms\":{}}");

