	add("retina", "{\"term\":\"retina\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From \u0027retina\u0027 the diminutive form of Latin \u0027rete\u0027 (net) probably from the phrase (\u0027tunica\u0027 {{m|la|*retina}}, literally \u0026quot;net-like tunic\u0026quot;, used to describe the blood vessel system at the back of the eye.(Gerard of Cremona may have created this phrase as a translation for Arabic \u0027(tabaqa) sabakiva\u0027 \u0026quot;net-like layer\u0026quot;, which translates Ancient greek (to 1453) \u0027ἀμφιβληστροειδής\u0027 (\u0027χιτών\u0027 \u0027).\u0026lt;ref\u0026gt;[http://www.etymonline.com/index.php?allowed_in_frame\u003d0\u0026amp;search\u003dretina\u0026amp;searchmode\u003dnone Online Etymological Dictionary]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Human eye cross-sectional view thumb|right|280px|Illustration showing parts of the human eye, including the retina\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The thin layer of cells at the back of the eyeball where light is converted into neural signals sent to the brain\", \"priority\":2}]}, \"synonyms\":{}}");

