	add("retire", "{\"term\":\"retire\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Proto-Germanic\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027retirer\u0027 (draw back) from prefix \u0027re-\u0027 (back) + verb \u0027tirer\u0027 (draw, pull) from Old french (842-ca. 1400) \u0027tirer\u0027 \u0027tirier\u0027 (to draw out, arrange, adorn) from \u0027tire\u0027 \u0027tiere\u0027 (row, rank, order, dress) of Proto-germanic origin akin to Old English and Old Saxon {{m|ang|tīr||fame, glory, ornament}}, Old English {{m|ang|tīer||rank, row}}, Old High German \u0027ziari\u0027 \u0027zēri\u0027 (ornament) German \u0027zier\u0027 (ornament, adornment) German \u0027zieren\u0027 (to adorn) More at \u0027tier\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of retiring, or the state of being retired; also, a place to which one retires\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A call sounded on a bugle, announcing to skirmishers that they are to retire, or fall back\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At the \u0027\u0027retire\u0027\u0027, the cavalry fell back\", \"priority\":3}]}, \"synonyms\":{}}");

