	add("retirement", "{\"term\":\"retirement\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French from \u0027retirer|lang\u003dfr\u0027 () from \u0027re-\u0027 + \u0027tirer|lang\u003dfr\u0027 () + English suffix \u0027-ment\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of retiring; withdrawal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, \u0027Chelsea 6-0 Wolves\u0027 [http://www.bbc.co.uk/sport/0/football/19632463\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Chelsea captain was a virtual spectator as he was treated to his side\u0027s biggest win for almost two years as Stamford Bridge serenaded him with chants of \u0026quot;there\u0027s only one England captain,\u0026quot; some 48 hours after he announced his \u0027\u0027retirement\u0027\u0027 from international football\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The state of being retired; seclusion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The portion of one\u0027s life after retiring from one\u0027s career\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A place of seclusion or privacy; a place to which one withdraws or retreats; a private abode\", \"priority\":6}]}, \"synonyms\":{}}");

