	add("retreat", "{\"term\":\"retreat\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027retret\u0027, from Old french (842-ca. 1400) \u0027retrait\u0027 or \u0027retret\u0027 (to draw back), from Latin \u0027retrahere\u0027 (retract).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of pulling back or withdrawing, as from something dangerous, or unpleasant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In a \u0027\u0027retreat\u0027\u0027 he outruns any lackey\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of reversing direction and receding from a forward position\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A peaceful, quiet place affording privacy or security\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"L\u0027Estrang\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He built his son a house of pleasure, and spared no cost to make a delicious \u0027\u0027retreat\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"That pleasing shade they sought, a soft \u0027\u0027retreat\u0027\u0027 / From sudden April showers, a shelter from the heat\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A period of retirement, seclusion, or solitude\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A period of meditation, prayer or study\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Withdrawal by military force from a dangerous position or from enemy attack\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A signal for a military withdrawal\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A bugle call or drumbeat signaling the lowering of the flag at sunset, as on a military base\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A military ceremony to lower the flag\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The move of a piece from a threatened position\", \"priority\":16}]}, \"synonyms\":{}}");

	add("retrenchment", "{\"term\":\"retrenchment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\"], \"text\":\"From French \u0027retranchement\u0027 Old french (842-ca. 1400) \u0027retrenchemant\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reduction or curtailment; often referring to a business or government agency cutting back operations or laying off workers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A defensive work constructed within a fortification to make it more defensible (by allowing defenders to retreat into and fight from it even after the enemy has taken the outer work\", \"priority\":2}]}, \"synonyms\":{}}");

	add("retrial", "{\"term\":\"retrial\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|re|trial|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A second trial, by the original court, if the original trial was found to be improper or unfair\", \"priority\":1}]}, \"synonyms\":{}}");

	add("retribution", "{\"term\":\"retribution\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin from \u0027retribuere\u0027 (assign again)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Punishment inflicted in the spirit of moral outrage or personal vengeance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Richard A. Posner, \u0027The economics of justice\u0027m p.208\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Whereas \u0027\u0027retribution\u0027\u0027 focuses on the offender\u0027s wrong, retaliation focuses on the impulse of the victim (or of those who sympathize with him) to strike back at the offender\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, w:Barbara Barbara Hanawalt, \u0027Medieval crime and social control\u0027, p.73\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1. Revenge is for an injury; retribution is for a wrong\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2. Retribution sets an internal limit to the amount of the punishment according to the seriousness of the wrong; revenge need not\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"3. Revenge is personal; the agent of retribution need have no special or personal tie to the victim of the wrong for which he exacts retribution\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"4. Revenge involves a particular emotional tone, pleasure in the suffering of another, while retribution need involve no emotional tone\", \"priority\":8}]}, \"synonyms\":{}}");

	add("retributionist", "{\"term\":\"retributionist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|retribution|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who holds that there must be retribution (vengeance, punishment) for transgressions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1893\u0027\u0027 October, \u0027New Ways With Old Offenders\u0027, in \u0027The Nineteenth Century\u0027, volume 34, page 625\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027retributionist\u0027\u0027 says — I quote from Sir James F. Stephen — ‘The criminal law proceeds upon the principle that it is morally right to hate criminals, and it confirms and justifies that sentiment by inflicting upon criminals punishments which express it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Evan J. Mandery, \u0027Capital Punishment in America: A Balanced Examination\u0027, page 475\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A \u0027lex talionis\u0027 \u0027\u0027retributionist\u0027\u0027 would likely maintain that neither the passage of time nor a radical change in the character of the defendant alleviates society\u0027s duty to punish the properly convicted. Immanuel Kant captured this notion when he argued that before a civil society could disband, it had to execute the last murderer in its prisons\", \"priority\":5}]}, \"synonyms\":{}}");

	add("retributivism", "{\"term\":\"retributivism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A philosophy of law that criminals should be punished (retribution) for the harm they have caused\", \"priority\":1}]}, \"synonyms\":{}}");

	add("retriever", "{\"term\":\"retriever\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|retrieve|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of gun dog that retrieves game for a hunter\", \"priority\":1}]}, \"synonyms\":{}}");

	add("retroactiveness", "{\"term\":\"retroactiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|retroactive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being retroactive\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1908\u0027\u0027, Hubert Bruce Fuller, \u0026quot;Congressional Salary Legislation ,\u0026quot; \u0027The North American Review\u0027, vol. 188, no. 635, p. 551\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Then, too, it was divorced from the disagreeable features of \u0027\u0027retroactiveness\u0027\u0027 and partisanship which had inspired the particularly bitter condemnation of the Salary Acts of 1816 and 1873\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1960\u0027\u0027, \u0026quot;Summaries of Papers Delivered at the 119th Annual Meeting,\u0026quot; \u0027Journal of the American Statistical Association\u0027, vol. 55, no. 290, p. 371\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The author reviews the history of the Wholesale Price Index, the Consumer Price Index, and Parity Index, pointing out the wide variation that in the past has characterized frequency of revision (intervals of revision), \u0027\u0027retroactiveness\u0027\u0027 of revisions\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Bruce A. Blonigen and Jee-Hyeong Park, \u0026quot;Dynamic Pricing in the Presence of Antidumping Policy: Theory and Evidence,\u0026quot; \u0027The American Economic Review\u0027, vol. 94, no. 1, p. 138n\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"However, it can be shown that a model with this retroactive feature will generate qualitatively identical results with respect to the dynamic pricing behavior as a model without \u0027\u0027retroactiveness\", \"priority\":7}]}, \"synonyms\":{}}");

	add("retrocomputing", "{\"term\":\"retrocomputing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027retro-\u0027 + \u0027computing\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The hobby of using obsolete computer equipment\", \"priority\":1}]}, \"synonyms\":{}}");

