	add("retrodiene", "{\"term\":\"retrodiene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"used attributively to describe the removal of a previously added diene moiety from a molecul\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"http://www.sigmaaldrich.com/etc/medialib/docs/Aldrich/Acta/al_acta_30_01.pdf Aldrichimica Acta Volume 30 No 4] (pdf) from [http://www.sigmaaldrich.com/chemistry/chemical-synthesis/learning-center/aldrichimica-acta.html Sigma-Aldrich\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Since reaction occurs specifically at the cyclobutene π-bond, the opportunity to effect a \u0027\u0027retrodiene\u0027\u0027 loss of cyclopentadiene becomes an option\", \"priority\":3}]}, \"synonyms\":{}}");

	add("retrofuture", "{\"term\":\"retrofuture\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|retro|future|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An outdated vision of the future\", \"priority\":1}]}, \"synonyms\":{}}");

	add("retrofuturism", "{\"term\":\"retrofuturism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|retro|futurism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The revival of historical conceptions of the future in media and design\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, David Bell, \u0027Science, Technology and Culture\u0027, Open University Press (2006), ISBN 9780335213269, [http://books.google.com/books?id\u003dpEcqiii4MOUC\u0026amp;pg\u003dPA89 pages 89-90\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Even the aesthetics of its interface, with a kind of \u0027Star Trek\u0027-like \u0027\u0027retrofuturism\u0027\u0027, makes users feel as if their computer is doing the things we imagined computers would be doing, rather than the humdrum business of typing, filing and storing\", \"priority\":3}]}, \"synonyms\":{}}");

	add("retrogamer", "{\"term\":\"retrogamer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|retro|gamer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A retrogaming enthusiast\", \"priority\":1}]}, \"synonyms\":{}}");

