	add("retromingency", "{\"term\":\"retromingency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the characteristic of urinating backwards, present in certain animals\", \"priority\":1}]}, \"synonyms\":{}}");

	add("retromingent", "{\"term\":\"retromingent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From {{m|en|retro-||backwards}} + past participle of Latin \u0027mingō\u0027 (i urinate)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An animal that urinates backwards - such as the camel, hippo or raccoon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1646\u0027\u0027, Sir Thomas Browne, \u0027Pseudodoxia Epidemica\u0027, III.17\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I confess by reason of the postick and backward position of the feminine parts in quadrupedes, they can hardly admit the substitution of a protrusion, effectuall unto masculine generation; except it be in \u0027\u0027Retromingents\u0027\u0027, and such as couple backward\", \"priority\":3}]}, \"synonyms\":{}}");

	add("retrophilia", "{\"term\":\"retrophilia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The attraction to and preference for that which is from or characteristic of the past\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Kevin Alexander, \u0026quot;[http://www.boston.com/lifestyle/fashion/articles/2010/11/21/the_secret_to_selling_cool/ The secret to selling cool]\u0026quot;, \u0027Boston Globe\u0027, 21 November 2010\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At the same time, a wave of \u0027\u0027retrophilia\u0027\u0027 started to crest. Clothing companies like Homage (which reproduces vintage-esque T\u0027s celebrating sports and pop culture from the \u002770s through the \u002790s) came up with unique ways to commercialize the interest in yesteryear\", \"priority\":3}]}, \"synonyms\":{}}");

	add("retroreflector", "{\"term\":\"retroreflector\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|retro|reflector|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A retroreflective device or surface\", \"priority\":1}]}, \"synonyms\":{}}");

